import React, { Component } from "react";
import Score from "../Score"


class NavBar extends Component {
    render() {
        return (<nav className="navbar sticky-top navbar-light" >

            <div className="col-sm-4">
                <a className="navbar-brand" href="/"><h3>Clicky Game</h3></a>
            </div>
            <div className="col-sm-4">
                <h3>{this.props.message}</h3>
            </div>
            <div className="col-sm-4">
                <h3><Score score={this.props.score} topScore={this.props.topScore} /></h3>
            </div>
        </nav >)

    };

    render() {
        return (<div className="App">
            <NavBar
                message={this.state.message}
                score={this.state.score}
                topScore={this.state.topScore}
            />
            <Title /><div className="row">
                <div className="col-sm-1"></div>
                <div className="col-sm-10">{
                    this.state.images.map(char => {
                        return <Card key={char.id} id={char.id} classname={"img img-thumbnail"} src={require(char.image + ".jpg")} alt={char.name} onClick={this.clickHandler} />
                    })
                }
                </div>
                <div className="col-sm-1"></div>
            </div>
            <Footer />
        </div>
        );
    };


};
export default NavBar;
